INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(278296, 'ptBR', '<Marmaduque olha para você ansiosamente.>', '', 58238),
(278176, 'ptBR', '<Marmaduque olha para você com expectativa.>', '', 58238),
(11145, 'ptBR', '', 'As estrelas desta época iluminam outros caminhos – raios de força e esperança para as eras vindouras.', 58238),
(279769, 'ptBR', 'É bom ficar ao ar livre de novo!\n\nFiquei meio pra baixo depois que a gente entrou em greve com a Cabogrampo. Os contratantes dela não estavam pagando ninguém, nem ela! Aí, ela encostou o Princesa e foi cada um pro seu lado.\n\nMas agora a gente já tá pronto pra outra, haha!\n\nMenos a Du\'una. Ela tá com medo das bwon\'tulak, e pudera.\n\nA gente tá indo bem pro meio de uma tempestade, mas Shango sempre protege nessas horas!', '', 58238),
(279768, 'ptBR', '', 'Tá indo pra Ilha das Sirenas?\n\n<Du\'una faz uma careta e cospe.>\n\nEu falei pra Cabogrampo que isso é mau sinal. Já ouvi foi história dessas sirenas. Em Zandali, a gente chama de \"bwon\'tulak\", Solistas da Morte. Ê, bicho ruim.\n\nMeu mojo é forte, nunca vi nenhuma nesse tempo todo sobrevoando o mar. Mas e agora, que elas tão no nome do lugar pra onde a gente vai?\n\n<Du\'una se curva e balança a cabeça.>\n\nSó Shango pra guiar os ventos.', 58238),
(279747, 'ptBR', 'Quase nada, infelizmente. Botei os meus melhores pra ver o que eles descobriam.\n\nDescobriram pouco: só alguns contos de Boralus. O registro mais antigo que encontramos foi uma fábula kultirena, ou algo alertando sobre os perigos do \"Chamado\", seja lá o que for. \n\nNão encontrei nenhuma carta náutica nem nada. Parece que quase ninguém teve coragem de se aproximar, mas, pra mim, é aí que está a oportunidade!\n\nPor sorte, a Ricket e a minha equipe de solo conseguiram dados suficientes pra ajudar a gente a encontrar o caminho de volta.', '', 58238),
(278425, 'ptBR', 'Você e metade de Khaz Algar querem saber! \n\nPrimeiro os Arathi e os terranos vêm perguntar, aí, do nada, eles se mandam nas aeronaus e nas máquinas toupeiras deles! \n\nAh, se eu ainda tivesse meus contatos de perfuratriz a jato, aposto que a gente chegava antes!\n\nMas beleza, sabe do que mais? \n\nPartiu Ilha das Sirenas. Já ouviu falar?', '', 58238),
(273289, 'ptBR', 'Ei, boas-vindas a bordo! Já tem terranos e Arathi na ilha. Temos que alcançá-los!', '', 58238),
(273102, 'ptBR', 'Viu? Chegamos atrasados na festa. Me encontra lá embaixo e olha onde pisa, hehehe.', '', 58238);
